import React from 'react';
import SearchForm from '../SearchForm/SearchForm.jsx';
import MoviesCardsList from '../MoviesCardList/MoviesCardList.jsx';
import styles from './SavedMovies.module.css'; 

function SavedMovies({savedMovies, handleRemove}) {
  return (
    <main className={styles["saved-movies"]}>
      <SearchForm />
      <MoviesCardsList savedMovies={{savedMovies}} onRemove={handleRemove}/>
    </main>
  );
}

export default SavedMovies;
